        var iosUrl = 'https://apps.apple.com/us/app/id1520001187';
        var androidUrl = 'https://play.google.com/store/apps/details?id=com.idle.bus.tycoon';

        function getUrl() {
            let userAgent = navigator.userAgent || navigator.vendor;
            if (/(iPhone|iPad|iPod|iOS)/i.test(userAgent)) {
                userAgent = 'ios'
            } else {
                userAgent = 'android'
            }
            return userAgent === 'ios' ? this.iosUrl : this.androidUrl;
        };
        var storeUrl = getUrl();

        function getWidthHeight() {
            if (typeof dapi !== 'undefined') {
                let size = dapi.getScreenSize();
                return [size.width, size.height];
            }
            else {
                let w = document.body.clientWidth;
                let h = document.body.clientHeight;
                // console.log("获取到的宽高 screen:" + screen.width + " " + screen.height + " inner:" + window.innerWidth + " " + window.innerHeight + " body:" + document.body.clientWidth + " " + document.body.clientHeight);
                return [w, h];
            }
        };

        function isLandscape() {
            let wh = getWidthHeight();
            w = wh[0];
            h = wh[1];
            if (w <= h) {
                isLandscape = false
            } else {
                isLandscape = true
            }
            return isLandscape;
        }

        function calGifSize(w, h) {
            let rate = w / h;
            let want = 16 / 9;
            if (w >= h) {
                want = 16 / 9;
            }
            else {
                want = 9 / 16;
            }

            // console.log(rate);
            // console.log(want);
            if (rate > want) {
                let height = h;
                let width = Math.floor(want / rate * w);
                return [width, height];
            }
            else {
                let width = w;
                let height = Math.floor(rate / want * h);
                return [width, height];
            }
        }

        function changeSize() {
            let wh = getWidthHeight();
            w = wh[0];
            h = wh[1];
            console.log("计算屏幕宽高:" + w + " " + h);
            let showSize = calGifSize(w, h);
            // console.log(showSize);
            showW = showSize[0];
            marginLeft = (w - showW) / 2;
            showH = showSize[1];
            marginTop = (h - showH) / 2;
            console.log("计算结果:" + showW + " " + marginLeft + " " + showH + " " + marginTop);
            if (w >= h) {
                toShow = document.getElementById("heng");
                notToShow = document.getElementById("shu");
                console.log("show heng");

            }
            else {
                toShow = document.getElementById("shu");
                notToShow = document.getElementById("heng");
                console.log("show shu");
            }
            toShow.style.display = "block";
            toShow.style.width = showW + "px";
            toShow.style['margin-left'] = marginLeft + "px";
            toShow.style.height = showH + "px";
            toShow.style['margin-top'] = marginTop + "px";

            // toShow.style.width = "100%";
            // toShow.style.height = "100%";

            notToShow.style.display = "none";
            // document.getElementById('debug').innerHTML = "debug";
        }

        function click() {
            console.log("click and jump " + storeUrl);
            if (typeof sdk !== 'undefined') {
                console.log("into sdk click");
                sdk.click();
            }
            else {
                window.location.href = storeUrl;
            }
        }

        document.getElementById("heng").addEventListener('click', click);
        document.getElementById("heng").addEventListener('touchstart', click);
        document.getElementById("shu").addEventListener('click', click);
        document.getElementById("shu").addEventListener('touchstart', click);

        //run all 
        function start() {
            if (typeof sdk !== 'undefined') {
                console.log("into sdk start");
                sdk.start();
            }
            else {
                innerStart();
            }
        }
        function innerStart() {
            window.addEventListener("resize", changeSize);
            changeSize();
            //
            if (typeof sdk_config !== 'undefined') {
                if ('click_after_second' in sdk_config && sdk_config['click_after_second'] > 0) {
                    let se = sdk_config['click_after_second'];
                    console.log("在 " + se + "秒后点击");
                    setTimeout(click, se * 1000);
                }
            }
        }
        start();
    </script>
</body>

</html>
